(17, 'main_lead', '18', '17', 'SRI AKHIL KHETAN _KHETAN VASTRALAYA', '20', '71', '', '', '28,18,20', '', '53', '<p>SIR WE HAVE MEET THIS PARTY TO CONVINCED HIM TO WORK WITH US . HE IS WORKING WITH OTHER TRANSPORT FROM BHIWANDI AND AHMEDABAD @500/QNTL NETT FROM AHMEDABAD AND 520/QNTL NETT FROM BHIWANDI . WE HAVE QUOTED BELOW RATE TO PARTY KINDLY CONFIRM&nbsp;</p><p>BHIWANDI - 530/QNTL NETT</p><p>AHMEDABAD-500/QNTL NETT&nbsp;</p><p>HE IS NOT GIVING ANY OTHER CHARGES BUT GIVE US FULL DELIVERY CHARGE 50 DOCKET+25/NUG LABOUR&nbsp;&nbsp;</p>', '', '', '', '65', '', '', 'A', '28', '28', '2019-01-02', '2019-01-02', '0', '16'),
